import React from "react";

const Login = () => {
    const onChange = (e) => {
        console.log(e.target);
    }

  return (
    <div className='login_page'>
        <div className='login_box'>
            <div>
                <Input
                id="id"
                name="id"
                placeholder="아이디를 입력해주세요"
                onChange={onChange}
                />
            </div>
            <div>
                <Input
                id="password"
                name="password"
                type="password"
                placeholder="비밀번호를 입력해주세요"
                onChange={onChange}
                />
            </div>
            <div className="login_wan_btn"><a href="#">Login</a></div>
            <p>비밀번호가 기억나지 않으세요?</p>
            <p>아이디 찾기 / 비밀번호 찾기</p>
        </div> 
    </div>
  )
}

export default Login
